  return (
    <Router>
      <div>
        <Header />
        <div id="container">
          <Configurations />
        </div>
      </div>
    </Router>
  );
}

export default App;

<Router>
  <div className="App">
    <Navbar />
    <UserContext.Provider value={{ user, setUser }}>
      <Routes>
        <Route path="/" Component={Home} />
        <Route path="/chat/:room_id/:room_name" Component={Chat} />
      </Routes>
    </UserContext.Provider>
  </div>
</Router>;
